webpackJsonp([27750507829850],{5350:function(t,e){t.exports={data:{post:{html:"<p>Busy weekend. Christopher's day care is out-of-town today, so he's at a substitute. Mama's got a budget presentation in Munich and will be back late. I've got a company occasion this evening, so I can't pick Christopher up. His Aunt Kerstin will pick him up and he'll sleep over. Then tomorrow Mama's mother is moving. The situation has been declared as too risky for sons- and daughters-in-law, so Mama and Christopher will be driving up to help get things loaded. Christopher is responsible for keeping Oma distracted.</p>",fields:{title:"Can't Stop",date:"28 Sep 2001",url:"https://papascott.de/2001-09-28-cant-stop/"}}},pathContext:{slug:"/2001-09-28-cant-stop/",prev:{fields:{title:"Gonna Go For A Whirl",date:"27 Sep 2001",slug:"/2001-09-27-gonna-go-for-a-whirl/"}},next:{fields:{title:"Out Of Touch",date:"29 Sep 2001",slug:"/2001-09-29-out-of-touch/"}}}}}});
